import Logo from "../../src/ecdis.jpg";

export default function Map() {
  const data = true;

  return (
    <div>
      <section className="w-full h-screen relative">
        <img
          src={Logo}
          className="object-cover w-full h-full"
          alt="Image alt text"
        />
        <button className="absolute inset-x-0 shadow-xl bg-white w-3/4 md:w-2/5 mx-auto -mt-1 rounded-lg rounded-t-none">
          open chat
        </button>
      </section>
    </div>
  );
}
